// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Home from './components/Home';  // Ensure this component exists
import Login from './components/Login';  // Ensure this component exists
import Register from './components/Register';  // Ensure this component exists
import Dashboard from './components/Dashboard';  // Ensure this component exists

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/" exact component={Home} />
        <Route path="/login" component={Login} />
        <Route path="/register" component={Register} />
        <Route path="/dashboard" component={Dashboard} />
      </Switch>
    </Router>
  );
}

export default App;
